import './massage.css'

export const Massage=()=>{
    return(
<div className='flex'>
   <div className=""> MassageMenu</div>
   <div className=""> MassageArea</div>
</div>
    )
}

const MassageItem=()=>{
    return(

<div className='Massage'>

           <a  className={DialogBarElemStyle.FriendAvatar }href="#"> <img src="" alt="" /> </a>
           <div>
               <div className={DialogBarElemStyle.NameTimeMassageWrapper}>
           <span className={DialogBarElemStyle.FriendName}>{props.name}</span>
           <span className={DialogBarElemStyle.Time}>{props.time}</span>
           <div className={DialogBarElemStyle.FriendMassage}>{props.massage}</div>
           </div>

           </div>

   </div>
    )
}
